import React, { useState, useEffect } from 'react';

import Buttons from './components/Buttons'
import axios from 'axios';

import './App.css';

function App() {

  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/Ingredients')
      .then(res => {
        console.log(res.data)
        setData(res.data)
      })
  }, [])

  state = {
    count: 0
  }

  handleClick = () => {
    this.setState(({ count }) => ({
      count: count + 1
    }));
  };

  return (
    <div className="App">
      <ul>
        {data.map(data => (
          <li key={data.id}>{data.ingredientName}
          </li>
        ))}
      </ul>

      <Buttons
        clicked={this.handleClick} />
    </div>
  );
}

export default App;
